import { useState } from "react";
import { Link } from "react-router-dom";
import "./Header.css"
// import pic from "../Image/pic.jpg"


export default function Header() {
    window.addEventListener("scroll", function () {
    const header = document.querySelector(".navbar")
    header.classList.toggle("active", window.scrollY > 100)
  })

     const [Mobile, setMobile] = useState(false)
    return (
        <>
          <nav className="navbar">
                <div className="logo">
                  <img src="" alt="error"/>
                </div>
                <ul className={Mobile ? "nav-link":"nav-link"}onClick={() => setMobile(false)}>
                      <li><Link to="/" className="li">Home</Link></li>
                      <li><Link to="/project" className="li">Project</Link></li>
                      <li><Link to="/about" className="li">About</Link></li>
                      <li><Link to="/contact" className="li">Contact</Link></li>
                    </ul>
                <button className='toggle' onClick={() => setMobile(!Mobile)}>
              {Mobile ? <i className='fas fa-times close home-btn'></i> : <i className='fas fa-bars open'></i>}
            </button>
          </nav>
        </>
    )
}
